import React from 'react';
import './Conteudo.css';
import jordan from './jordan laranja.jpg'



function Conteudo() {
  return (
   <div className="block">
    <div >
     <p className="text">A JY MEDIA MARKETING é a impresa que iá criar a presença online do seu negocio trazendo assim mais publico e visibilidade. </p>
     <img className="image" src={jordan} alt="..." />
    </div>
    <div id="tabela" align="center">
    
    </div>
    </div>
  );
}

export default Conteudo;
